import React, { useEffect, useState } from 'react';
import './AdminReviews.css';

function AdminReviews() {
  const [reviews, setReviews] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem('token');
    fetch('http://localhost:5002/api/admin/reviews', {
      method: 'GET',
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    })
      .then((response) => response.json())
      .then(async (data) => {
        const reviewsWithScores = await Promise.all(
          data.map(async (review) => {
            const relevanceScore = await fetchRelevanceScore(review.reviewText);
            return { ...review, relevanceScore };
          })
        );
        setReviews(reviewsWithScores);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching reviews:', err);
        setError(err.message);
        setLoading(false);
      });
  }, []);

  const fetchRelevanceScore = async (reviewText) => {
    try {
        const response = await fetch('/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ text: reviewText }),
      });
      const data = await response.json();
      return data.relevanceScore;
    } catch (err) {
      console.error('Error fetching relevance score:', err);
      return 'N/A';
    }
  };

  const handleDeleteReview = async (reviewId) => {
    const token = localStorage.getItem('token');
    try {
      const response = await fetch(`http://localhost:5002/api/admin/reviews/${reviewId}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (response.ok) {
        setReviews(reviews.filter((review) => review._id !== reviewId));
        alert('Review deleted successfully.');
      } else {
        alert('Failed to delete review.');
      }
    } catch (err) {
      console.error('Error deleting review:', err);
      alert('Failed to delete review.');
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="admin-reviews-container">
      <h1>Manage Reviews</h1>
      <table className="admin-reviews-table">
        <thead>
          <tr>
            <th>User ID</th>
            <th>Order ID</th>
            <th>Product ID</th>
            <th>Review Text</th>
            <th>Rating</th>
            <th>Created At</th>
            <th>Relevance Score</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {reviews.map((review) => (
            <tr key={review._id}>
              <td>{review.user?.username || review.user?.email || 'Unknown User'}</td>
              <td>{review.orderId}</td>
              <td>{review.productId}</td>
              <td>{review.reviewText}</td>
              <td>{review.rating}</td>
              <td>{new Date(review.createdAt).toLocaleDateString()}</td>
              <td>{review.relevanceScore}</td>
              <td>
                <button
                  className="delete-button"
                  onClick={() => handleDeleteReview(review._id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminReviews;
